■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>大人の食卓に、ちょっと贅沢なごはんを。</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5387/1049612-01.jpg" width="600" height="600"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">【機能】<br>・圧力IH<br>・うまみ圧力蒸らし<br>・熟成炊き(白米・玄米)<br>・豪熱沸とう<br>・全面加熱<br>・保温選択(うるつや・高め保温)<br>・あったか再加熱<br>・フラット庫内<br>・洗える内ぶた<br>・内釜洗米OK<br>・時計式2メモリータイマー<br>・お知らせメロディー<br>・親切目盛(0.5カップごと)</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"><tr><td width="600" valign="top"><div align="center"><img width="600" height="600" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5387/1049612-02.jpg"><br><font size="3"></font></div><br></td></tr><tr><td width="600" valign="top"><div align="center"><img width="600" height="450" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5387/1049612-03.jpg"><br><font size="3"></font></div><br></td></tr></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">熟成炊き(玄米)メニューと高め保温を採用した、小容量の圧力IH。大型バックライト液晶を搭載し、好みの食感に炊き分ける4通りの炊き分け圧力を採用しています。</font></td></tr></table><br><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">熟成炊き(玄米)メニューと高め保温を採用した、小容量の圧力IH。大型バックライト液晶を搭載し、好みの食感に炊き分ける4通りの炊き分け圧力を採用しています。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">約幅23×奥行32×高さ19.5cm(ふた開き時の高さ36.5cm)</font><br><font color="#333333" size="-1">個装サイズ：27×39×25cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">約4200g</font><br><font color="#333333" size="-1">個装重量：4800g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">PP、印刷鋼板<br>内釜:アルミ+ステンレスt1.7mm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">炊飯容量(白米):0.09～0.54L(3合)<br>最大炊飯容量区分:A(※電磁誘導加熱方式(IH)0.54L以上0.99L未満)<br>定格電圧:100V<br>消費電力(炊飯時):700W<br>電源コード:コードリール式1.0m</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">付属品</font></td><td align="left"><font color="#333333" size="-1">取扱説明書、保証書(保証期間:本体1年間、内釜3年間)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
