■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>「ちょっと一杯」のごはんが美味しく炊ける炊飯器。</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5296/3855bu-01.jpg" width="600" height="489"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">内釜の内面にはふっ素樹脂加工を施してありますので、汚れが落としやすくお手入れも楽々。</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"><tr><td width="600" valign="top"><div align="center"><img width="600" height="354" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5296/3855bu-02.jpg"><br><font size="3">0.5合から1.5合まで♪</font></div><br></td></tr><tr><td width="600" valign="top"><div align="center"><img width="600" height="464" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5296/3855bu-03.jpg"><br><font size="3"></font></div><br></td></tr></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">軽めのお茶碗一杯(0.5合)から3杯分(1.5合)まで、美味しく炊けます。ご飯が残ったり、家族の帰宅時間が違っても保温機能付で安心。</font></td></tr></table><br><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">軽めのお茶碗一杯(0.5合)から3杯分(1.5合)まで、美味しく炊けます。ご飯が残ったり、家族の帰宅時間が違っても保温機能付で安心。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">約165×155×180mm</font><br><font color="#333333" size="-1">個装サイズ：19×19×20cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">約1100g</font><br><font color="#333333" size="-1">個装重量：1300g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">本体:ポリプロピレン<br>内釜:アルミニウム合金(ふっ素樹脂加工)<br>計量カップ・しゃもじ:ポリプロピレン</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">100V-230W<br>コード長さ:約1.4m<br>容量:約90～270ml(0.5～1.5合)</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">付属品</font></td><td align="left"><font color="#333333" size="-1">取扱説明書、保証書(1年)、計量カップ、しゃもじ</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">中国</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
